-- script: lua
DEBUG=false


p={
 x=0*8,
 y=9*8,
	flp=false
}
gravity=0.3
friction=0.83

function TIC()

	if btn(0) then p.y=p.y-1 end
	if btn(1) then p.y=p.y+1 end
	if btn(2) then p.x=p.x-1 end
	if btn(3) then p.x=p.x+1 end

	cls(0)
	map(210,0)
	spr(256,p.x,p.y,0)
end

